import React from 'react'
import SignInForm from '../functional/SignIn'
import { MDBContainer } from 'mdbreact';

const SignInPage = (props) => { //it passes the Router properties from the parent comp (App.js)
    console.log(props);
    return (
        <MDBContainer>
            <SignInForm />
        </MDBContainer>
    )
}

export default SignInPage;
